import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../../store';

class Product extends Component {

    render() {
        return (
            <div class="row border">
                <aside class="col-3">
                    <article class="gallery-wrap pt-2 text-center">
                        <img src={require("../../images/tuner.png")} width="75px" />
                    </article>
                </aside>
                <aside class="col-9">
                    <div class="row">
                        <div class="col-12">
                            <div class="row pt-2 pb-2">
                                <span class="col-12" style={{ fontWeight: "600" }}>namaProduk asdasdasdasasdasdasdasd</span>
                                <span class="col-12 text-muted">xqty</span>
                                <span class="col-12 text-warning">Total Harga <sub class="text-muted"> (Rp sdasd each)</sub></span>

                                <span class="col-12">
                                    <button href="#" class="btn btn-danger float-right"> <i class="fas fa-trash-alt"></i></button>
                                </span>
                            </div>
                        </div>
                    </div>
                </aside>
            </div>
        );
    }
}

export default connect('', actions)
    (withRouter(Product));
